import React, { useState, useEffect } from 'react';
import { Card, List, Input, Button, Layout, Row, Col } from 'antd';
import io from 'socket.io-client';
import './ChatRoom.css'; // Import custom CSS

const { Sider, Content } = Layout;

const socket = io('http://localhost:5500');

const ChatRoom = () => {
  const [users, setUsers] = useState([]);
  const [selectedUser, setSelectedUser] = useState(null);
  const [messages, setMessages] = useState([]);
  const [message, setMessage] = useState('');

  useEffect(() => {
    socket.emit('get users');
    socket.on('users list', (usersList) => {
      setUsers(usersList);
    });

    if (selectedUser) {
      socket.emit('get chat history', selectedUser);
    }

    socket.on('chat history', (history) => {
      setMessages(history);
    });

    socket.on('chat message', (msg) => {
      setMessages((prevMessages) => [...prevMessages, msg]);
    });

    return () => {
      socket.off('users list');
      socket.off('chat history');
      socket.off('chat message');
    };
  }, [selectedUser]);

  const sendMessage = () => {
    const username = localStorage.getItem('username');
    if (!username) {
      console.error('Username is not found in localStorage');
      return;
    }

    console.log('Sending message from user:', username);
    socket.emit('chat message', { username, text: message, to: selectedUser });
    setMessage('');
  };

  const logout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('username');
    window.location.href = '/signin';
  };

  useEffect(() => {
    const chatContainer = document.getElementById('chat-container');
    if (chatContainer) {
      chatContainer.scrollTop = chatContainer.scrollHeight;
    }
  }, [messages]);

  return (
    <Layout style={{ height: '100vh' }}>
      <Row justify="center" align="middle" style={{ height: '100%', padding: '20px' }}>
        <Col xs={24} sm={22} md={20} lg={18} xl={16}>
          <Card className="chatroom-card" title="Chat Room" bordered={false} extra={<Button onClick={logout}>Logout</Button>}>
            <Row gutter={[16, 16]}>
              <Col xs={24} md={8}>
                <Sider width="100%" className="chatroom-sider">
                  <List
                    dataSource={users}
                    renderItem={(user) => (
                      <List.Item
                        style={{ cursor: 'pointer' }}
                        onClick={() => setSelectedUser(user.username)}
                      >
                        <strong>{user.username}</strong>
                      </List.Item>
                    )}
                  />
                </Sider>
              </Col>
              <Col xs={24} md={16}>
                <Content style={{ padding: '20px' }}>
                  {selectedUser ? (
                    <Card title={`Chat with ${selectedUser}`} bordered={false}>
                      <List
                        id="chat-container"
                        dataSource={messages}
                        renderItem={(item) => (
                          <List.Item>
                            <strong>{item.username}:</strong> {item.text}{' '}
                            <em>{new Date(item.timestamp).toLocaleTimeString()}</em>
                          </List.Item>
                        )}
                        style={{ marginBottom: '20px', maxHeight: '400px', overflowY: 'auto' }}
                      />
                      <Input
                        value={message}
                        onChange={(e) => setMessage(e.target.value)}
                        onPressEnter={sendMessage}
                        placeholder="Type a message..."
                        style={{ marginBottom: '10px' }}
                      />
                      <Button type="primary" onClick={sendMessage}>
                        Send
                      </Button>
                    </Card>
                  ) : (
                    <div>Please select a user to start chatting</div>
                  )}
                </Content>
              </Col>
            </Row>
          </Card>
        </Col>
      </Row>
    </Layout>
  );
};

export default ChatRoom;
